import React, { useEffect, useState } from 'react';


fetch('src/Data/SpeedSlalomRecord.json')
  .then(response => response.json())
  .then(data => console.log(data));

interface Athlete {
  name: string;
  records: Record[];
}

interface SpeedSlalomForm extends Athlete {
  data: any;
  side: "L" | "R";
  step: number;
  time: number;
  missedCone: number;
  kickCone: number;
  DQ?: boolean;
  endLine?: boolean;
  result: any;
  notes?: string;
}

const SpeedSlalom = () => {
  const [athletes, setAthletes] = useState<Athlete[]>([]);

  const [SpeedSlalomForm, setSpeedSlalomForm] = useState<SpeedSlalomForm>({
    name: '', Records: [], data: '', side: 'L', step: 0, time: 0.0,
    missedCone: 0, kickCone: 0, DQ: false, endLine: false, result: 0, notes: ''
  });
  const [result, setResult] = useState<string>('');

  useEffect(() => {
    fetch('src/Data/SpeedSlalomForm.json')
      .then(response => response.json())
      .then(data => setAthletes(data.athletes));
  }, []);

  const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();
    const result = SpeedSlalomForm.time + (SpeedSlalomForm.missedCone + SpeedSlalomForm.kickCone) * 0.2;
    console.log(SpeedSlalomForm);
    setSpeedSlalomForm({ ...SpeedSlalomForm, result });
  };

  const handleChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setSpeedSlalomForm({ ...SpeedSlalomForm, [event.target.name]: event.target.value });
  };

  return (
    <div className='main'>Speed Slalom
      <form onSubmit={handleSubmit}>
        <label>
          Name:
          <input type="text" name="name" value={SpeedSlalomForm.name} onChange={handleChange} />
        </label>
        <br />
        <label>
          Side:
          <input type="text" name="side" value={SpeedSlalomForm.side} onChange={handleChange} />
        </label>
        <br />
        <label>
          Step:
          <input type="number" name="step" value={SpeedSlalomForm.step} onChange={handleChange} />
        </label>
        <br />
        <label>
          Time:
          <input type="number" name="time" value={SpeedSlalomForm.time} onChange={handleChange} />
        </label>
        <br />
        <label>
          Missed:
          <input type="number" name="misseCone" value={SpeedSlalomForm.missedCone} onChange={handleChange} />
        </label>
        <br />
        <label>
          Kicked:
          <input type="number" name="kickCone" value={SpeedSlalomForm.kickCone} onChange={handleChange} />
        </label>
        <br />
        <p>
          Result:  {result}
        </p>
        <br />
        <button type="submit">Submit</button>
      </form>


      <div>
        {athletes.map((athlete, index) => (
          <div key={index}>
            <h2>{athlete.name}</h2>
            <ul>
              {athlete.records.map((record, index) => (
                <li key={index}>
                <p>Date: {record.date}</p>
                <p>Side: {record.side}</p>
                <p>Step: {record.step}</p>
                <p>Time: {record.time}</p>
                <p>Missed Cone: {record.missedCone}</p>
                <p>Kick Cone: {record.kickCone}</p>
                <p>DQ: {record.DQ ? 'Yes' : 'No'}</p>
                <p>End Line: {record.endLine ? 'Yes' : 'No'}</p>
                <p>Result: {record.result}</p>
                <p>Notes: {record.notes}</p>
                </li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export default SpeedSlalom;
